interface IColorPick {
  primary: string;
  secondary: string;
  shadow: string;
  text: string;
}

const primary = "#DEDED2";
const secondary = "#DEDED2";
const shadow = "#000";
const text = "#000";

export const colorPick: IColorPick = {
  primary,
  secondary,
  shadow,
  text,
};
